metadata = {
    'apiLevel': '2.8',
    'protocolName': 'tamGenetics_primerPoolingOnly_postOpt2',
    'author': 'Rachel Voyt',
    'description': '''This protocol is a modified version of the 'Custom CSV Transfer' protocol from OT2. The protocol includes steps to dilute overamplifying primers and create three primer pools (two split pools and one full pool) with two aliquots each at ~0.25 uM per primer. The protocol also allows for the use of two pipette types (p20_single and p300_single, both with filter tips), pauses to switch out primer plates, and adds a mixing step and air gap to each transfer.'''
}

def run(protocol):

    [pipette_type,
     pipette_mount,
     tip_type,
     tip_reuse,
     transfer_csv] = get_values(  # noqa: F821
        "pipette_type",
        "pipette_mount",
        "tip_type",
        "tip_reuse",
        "transfer_csv")

    # strip headers
    transfer_info = [[val.strip().lower() for val in line.split(',')]
                     for line in transfer_csv.splitlines()
                     if line.split(',')[0].strip()][1:]
    
    # load labware
    for line in transfer_info:
        s_lw, s_slot, d_lw, d_slot = line[2:4] + line[6:8]
        for slot, lw in zip([s_slot, d_slot], [s_lw, d_lw]):
            if not int(slot) in protocol.loaded_labwares:
                protocol.load_labware(lw.lower(), slot)

    # load tipracks
    tipracks = [protocol.load_labware(tip_type, slot)
            for slot in ['1', '4', '7']]

    # load pipettes
    pip = protocol.load_instrument(pipette_type, pipette_mount, tip_racks=tipracks)
            
    tip_count = 0
    tip_max = len(tipracks*96)

    def pick_up():
        nonlocal tip_count
        if tip_count == tip_max:
            protocol.pause('Please refill tipracks before resuming.')
            pip.reset_tipracks()
            tip_count = 0
        pip.pick_up_tip()
        tip_count += 1

    def parse_well(well):
        letter = well[0]
        number = well[1:]
        return letter.upper() + str(int(number))

    if tip_reuse == 'never':
        pick_up()

    # transfers for primer plates 1, 2, and 3
    for line in transfer_info:
        if 'set1_plates123' in line[0]:
            _, _, _, s_slot, s_well, h, _, d_slot, d_well, vol = line[:10]
            source = protocol.loaded_labwares[
            int(s_slot)].wells_by_name()[parse_well(s_well)].bottom(float(h))
            dest = protocol.loaded_labwares[
                int(d_slot)].wells_by_name()[parse_well(d_well)]
            if float(vol) > 5:
                if tip_reuse == 'always':
                    pick_up()
                pip.transfer(float(vol),
                            source,
                            dest,
                            mix_after = (10, 20),
                            new_tip='never')
                if tip_reuse == 'always':
                        pip.drop_tip()
            else:
                if tip_reuse == 'always':
                    pick_up()
                pip.transfer(float(vol),
                            source,
                            dest,
                            air_gap=1,
                            new_tip='never')
                if tip_reuse == 'always':
                        pip.drop_tip()
    if pip.hw_pipette['has_tip']:
        pip.drop_tip()

    # switch primer plates
    protocol.pause("Remove primer plates 1, 2, and 3 from the OT2 deck. Seal and place on ice. Then briefly vortex and spin down primer plates 4, 5, and 6. Remove seals and place on OT2 deck (plate 4 in slot 2, plate 5 in slot 5, and plate 6 in slot 8).")

    # transfers for primer plates 4, 5, and 6
    for line in transfer_info:
        if 'set2_plates456' in line[0]:
            _, _, _, s_slot, s_well, h, _, d_slot, d_well, vol = line[:10]
            source = protocol.loaded_labwares[
            int(s_slot)].wells_by_name()[parse_well(s_well)].bottom(float(h))
            dest = protocol.loaded_labwares[
                int(d_slot)].wells_by_name()[parse_well(d_well)]
            if float(vol) > 5:
                if tip_reuse == 'always':
                    pick_up()
                pip.transfer(float(vol),
                            source,
                            dest,
                            mix_after = (10, 20),
                            new_tip='never')
                if tip_reuse == 'always':
                        pip.drop_tip()
            else:
                if tip_reuse == 'always':
                    pick_up()
                pip.transfer(float(vol),
                            source,
                            dest,
                            air_gap=1,
                            new_tip='never')
                if tip_reuse == 'always':
                        pip.drop_tip()
    if pip.hw_pipette['has_tip']:
        pip.drop_tip()
